import React from 'react'
import {Outlet} from 'react-router-dom';
import TableComponent from '../components/TableComponent';
import '../components/css/main.css'

const Teacher = () => {
  return(
    <div className='studentTable'>
      <div className='teacherNavBar'>
        <ul>
          <li className='tableName'>Student Information</li>
          <li className='navButton'>Create Student</li>
          <li className='navButton'><a>Delete Student</a></li>
          <div className='userWidget'><span>Logged in as: User</span></div>
        </ul>
      </div>
      <div>
        <TableComponent />
      </div>
      <Outlet></Outlet>
    </div>
  );
}

export default Teacher
